import React from "react";
import { Video } from "lucide-react";

const Header = () => {
  return (
    <>
      <div className="w-full">
        <div className="flex">
          <div className="flex justify-center items-center w-full uppercase p-3 header">
            <Video className="mr-2" /> The Movie Central
          </div>
        </div>
      </div>
    </>
  );
};

export default Header;
